import React, { useState } from "react";
import Button from "@material-ui/core/Button";
import Dialog from "@material-ui/core/Dialog";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";
import { FormControl, OutlinedInput } from "@material-ui/core";
import useStyles from "./styles";
import curdApi from "../helper/curdApi";

export default function DeleteModal({ open, handleClose }) {
  const classes = useStyles();
  const [search, setSearch] = useState();
  const handleChange = (e) => {
    setSearch(e.target.value);
  };
  const handleClick = () => {
    if (!!search && search !== undefined) {
      curdApi.getAdd({});
    }
  };
  return (
    <div>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title" cl>
          {"آیا میخواهید این شهر را جدید  کنید"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
            <form className={classes.container}>
              <FormControl className={classes.input2} variant="outlined">
                <OutlinedInput
                  id="outlined-adornment"
                  placeholder={"نام شهر جدید"}
                  onChange={handleChange}
                  value={search}
                />
              </FormControl>
            </form>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} className={classes.btn}>
            لغو
          </Button>
          <Button onClick={handleClick} className={classes.btn} autoFocus>
            بله
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
